import React from "react";

const AuthContext = React.createContext({
  isLoggedIn: false,
  onLogOut: () => {},
  //   default 함수라도 작성해 두는게 IDE에서 자동완성을 시켜주기 때문에, 사용할 함수를 넣어주는것이 좋다.
});

export default AuthContext;
